import React from "react";
import { useState, useEffect } from "react";
import { Card, CardContent } from "./components/ui/card.js";

const API_URL = "https://script.google.com/macros/s/AKfycbyS6WZdHmwvWGZ-yI7GlXI3XSwNex1RzcZudVpk9hRNkGJYt_EIN7jfRoSnEaXkSfOC/exec";

export default function MaritimeTranslator() {
    const [entries, setEntries] = useState([]);

    useEffect(() => {
        fetch(API_URL)
            .then(response => response.json())
            .then(data => {
                setEntries(data);
            })
            .catch(error => console.error("Fetch error:", error));
    }, []);

    return (
        <div className="p-4 w-full max-w-2xl mx-auto">
            <h1 className="text-2xl font-bold mb-4">Maritime Translator</h1>

            <Card>
                <CardContent>
                    <div className="grid grid-cols-2 gap-4">
                        <div className="font-bold border p-2 rounded-md">English Term</div>
                        <div className="font-bold border p-2 rounded-md">Chinese Translation</div>
                        {entries.map((row, index) => (
                            <React.Fragment key={index}>
                                <div className="border p-2 rounded-md">{row[0]}</div>
                                <div className="border p-2 rounded-md">{row[1]}</div>
                            </React.Fragment>
                        ))}
                    </div>
                </CardContent>
            </Card>
        </div>
    );
}
